const videos = [
  {
    name: "video of me",
    duration: "15 min",
    id: 1,
  },
  {
    name: "video my ",
    duration: "5 min",
    id: 2,
  },
];
function App() {
  const [open, setOpen] = React.useState(false);

  const toggleOpen = () => {
    setOpen(!open);
  };

  return (
    <div className="div">
      <button className="open" onClick={toggleOpen}>
        Open CODE
      </button>
      {open && <img src="https://i.gifer.com/EaH.gif" alt="Gif" width={400} />}
    </div>
  );
}

export default App;
